import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./algorithm.css";
import AlgorithmForm from "./form/algorithmForm";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

function Algorithm() {
  return (
    <Container fluid className="componentContainer">
      <Row className="containerRow">
        <Col md={4}>
          <Container className="descriptionContainer">
            Sed ut perspiciatis unde omnis iste natus error sit voluptatem
            accusantiumAt vero eos et accusamus et iusto odio dignissimos
            ducimus qui blanditiis praesentium voluptatum deleniti atque
            corrupti quos dolores et quas molestias excepturi sint occaecati
            cupiditate non provident, similique sunt in culpa qui officia
            deserunt mollitia animi, id est laborum et dolorum fuga. Et harum
            quidem rerum facilis est et expedita distinctio. Nam libero tempore,
            cum soluta nobis est eligendi optio cumque nihil impedit quo minus
            id quod maxime placeat facere possimus, omnis voluptas assumenda
            est, omnis dolor repellendus. Temporibus autem quibusdam et aut
            officiis debitis aut rerum necessitatibus saepe eveniet ut et
            voluptates repudiandae sint et molestiae non recusandae. Itaque
            earum rerum hic tenetur a sapiente delectus, ut aut reiciendis
            voluptatibus maiores alias consequatur aut perferendis doloribus
            asperiores
          </Container>
        </Col>

        <Col md={8}>
          <Row className="formRow">
            <Col md={12}>
              <Container>
                <AlgorithmForm>
                </AlgorithmForm>
              </Container>
            </Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
}

export default Algorithm;
